DROP TABLE IF EXISTS `context`;
CREATE TABLE `context` (
`context_id` VARCHAR(64) NOT NULL,
`category` VARCHAR(255) DEFAULT null,
`sub_category` VARCHAR(255) DEFAULT null,
`text` VARCHAR(255) DEFAULT null,
`value` VARCHAR(255) DEFAULT null,
`created_by` VARCHAR(64) DEFAULT null,
`created_time` DATETIME DEFAULT null,
`company_id` VARCHAR(64) DEFAULT null,
PRIMARY KEY (`context_id`)
);



DROP TABLE IF EXISTS `documents`;
CREATE TABLE `documents` (
`doc_id` VARCHAR(64) NOT NULL,
`doc_file_name` VARCHAR(255) DEFAULT null,
`doc_path` VARCHAR(255) DEFAULT null,
`created_by` VARCHAR(64) DEFAULT null,
`created_time` DATETIME DEFAULT null,
`checksum` VARCHAR(255) DEFAULT null,
PRIMARY KEY (`doc_id`)
);



DROP TABLE IF EXISTS `draws`;
CREATE TABLE `draws` (
`draw_id` VARCHAR(64) NOT NULL,
`project_id` VARCHAR(64) DEFAULT null COMMENT '项目ID',
`draws_name` VARCHAR(255) DEFAULT null COMMENT '图纸名称',
`draws_type` VARCHAR(64) DEFAULT null COMMENT '图纸类型',
`draws_url` VARCHAR(512) DEFAULT null COMMENT '图纸url',
`image_url` VARCHAR(255) DEFAULT null,
`bounding_box` VARCHAR(1024) DEFAULT null,
`state` INT DEFAULT 1 COMMENT '状态(0, 禁用  1,启用)',
`version` INT DEFAULT 1 COMMENT '版本',
`upload_by` VARCHAR(64) DEFAULT null COMMENT '上传人',
`created_by` VARCHAR(64) DEFAULT null COMMENT '创建人',
`created_time` DATETIME DEFAULT null COMMENT '创建时间',
`updated_by` VARCHAR(64) DEFAULT null COMMENT '更新人',
`updated_time` DATETIME DEFAULT null COMMENT '更新时间',
`is_deleted` INT DEFAULT 0 COMMENT '删除标记',
`deleted_by` VARCHAR(64) DEFAULT null COMMENT '删除人',
`deleted_time` DATETIME DEFAULT null COMMENT '删除时间',
PRIMARY KEY (`draw_id`)
);



