DROP TABLE IF EXISTS `excel_templates_copy1`;
CREATE TABLE `excel_templates_copy1` (
`template_id` INT NOT NULL AUTO_INCREMENT,
`template_name` VARCHAR(1024) DEFAULT null,
`template_file_uri` VARCHAR(1024) DEFAULT null,
`template_state` INT DEFAULT null,
`class_uri` VARCHAR(1024) DEFAULT null,
`category` VARCHAR(64) DEFAULT null,
`created_by` VARCHAR(64) DEFAULT null,
`created_time` DATETIME DEFAULT null,
`updated_by` VARCHAR(64) DEFAULT null,
`updated_time` DATETIME DEFAULT null,
`is_deleted` INT DEFAULT null,
`deleted_by` VARCHAR(64) DEFAULT null,
`deleted_time` DATETIME DEFAULT null,
`template_preview_uri` VARCHAR(1024) DEFAULT null,
`where_used` VARCHAR(64) DEFAULT null,
PRIMARY KEY (`template_id`)
);



DROP TABLE IF EXISTS `file_export_log`;
CREATE TABLE `file_export_log` (
`export_id` VARCHAR(64) NOT NULL,
`export_sys_id` VARCHAR(64) NOT NULL,
`file_name` VARCHAR(1024) DEFAULT null,
`export_type` VARCHAR(128) DEFAULT null,
`format` VARCHAR(64) DEFAULT null,
`state` INT DEFAULT null,
`download_url` VARCHAR(1024) DEFAULT null,
`pdf_url` VARCHAR(512) DEFAULT null COMMENT 'PDF路径',
`created_by` VARCHAR(64) DEFAULT null,
`created_time` DATETIME DEFAULT null,
`updated_by` VARCHAR(64) DEFAULT null,
`updated_time` DATETIME DEFAULT null,
`is_deleted` INT DEFAULT 0,
`deleted_by` VARCHAR(64) DEFAULT null,
`deleted_time` DATETIME DEFAULT null,
PRIMARY KEY (`export_id`)
);



DROP TABLE IF EXISTS `floor_draws`;
CREATE TABLE `floor_draws` (
`floor_draw_id` VARCHAR(64) NOT NULL,
`floor_id` VARCHAR(64) DEFAULT null,
`draw_id` VARCHAR(64) DEFAULT null COMMENT '图纸Id',
`state` INT DEFAULT null COMMENT '状态(0, 禁用  1,启用)',
`created_by` VARCHAR(64) DEFAULT null COMMENT '创建人',
`created_time` DATETIME DEFAULT null COMMENT '创建时间',
`updated_by` VARCHAR(64) DEFAULT null COMMENT '最近更改人',
`updated_time` DATETIME DEFAULT null COMMENT '最近更改时间',
`is_deleted` INT DEFAULT 0 COMMENT '逻辑删除标记 0:未删除 1:已删除',
`deleted_by` VARCHAR(64) DEFAULT null COMMENT '删除人',
`deleted_time` DATETIME DEFAULT null COMMENT '删除时间',
PRIMARY KEY (`floor_draw_id`)
);



DROP TABLE IF EXISTS `floors`;
CREATE TABLE `floors` (
`floor_id` VARCHAR(64) NOT NULL,
`floor_no` VARCHAR(255) DEFAULT null,
`floor_name` VARCHAR(255) DEFAULT null,
`building_id` VARCHAR(64) DEFAULT null,
`number_of_suite` INT DEFAULT null,
`measurement_point_count_1` INT DEFAULT null COMMENT '混凝土阶段总测量点数',
`measurement_point_count_2` INT DEFAULT null COMMENT '抹灰阶段总测量点数',
`created_by` VARCHAR(64) DEFAULT null,
`created_time` DATETIME DEFAULT null,
`is_deleted` INT DEFAULT 0,
`deleted_by` VARCHAR(64) DEFAULT null,
`deleted_time` DATETIME DEFAULT null,
`draw_floor_id` VARCHAR(64) DEFAULT null,
PRIMARY KEY (`floor_id`)
