DROP TABLE IF EXISTS `issues`;
CREATE TABLE `issues` (
`issue_id` VARCHAR(64) NOT NULL,
`project_id` VARCHAR(64) DEFAULT null,
`building_id` VARCHAR(64) DEFAULT null,
`floor_id` VARCHAR(64) DEFAULT null,
`suite_id` VARCHAR(64) DEFAULT null,
`room_id` VARCHAR(64) DEFAULT null,
`draw_room_id` VARCHAR(64) DEFAULT null,
`stage_id` VARCHAR(64) DEFAULT null,
`measurement_item_id` VARCHAR(64) DEFAULT null,
`measured_value` VARCHAR(64) DEFAULT null,
`measured_value_wall` VARCHAR(64) DEFAULT null,
`measured_value_coordinates` VARCHAR(2048) DEFAULT null,
`measured_ruler_coordinates` VARCHAR(255) DEFAULT null,
`issue_owner` VARCHAR(64) DEFAULT null,
`due_date` DATETIME DEFAULT null,
`issue_desc` VARCHAR(64) DEFAULT null,
`issue_source` VARCHAR(64) DEFAULT null,
`reference_id` VARCHAR(64) DEFAULT null,
`draw_id` VARCHAR(64) DEFAULT null,
`created_by` VARCHAR(64) DEFAULT null,
`created_time` DATETIME DEFAULT null,
`updated_by` VARCHAR(64) DEFAULT null,
`updated_time` DATETIME DEFAULT null,
`is_deleted` INT DEFAULT 0,
`deleted_by` VARCHAR(64) DEFAULT null,
`deleted_time` DATETIME DEFAULT null,
`issue_state` INT DEFAULT null,
`closed_by` VARCHAR(64) DEFAULT null,
`closed_time` DATETIME DEFAULT null,
PRIMARY KEY (`issue_id`)
);



DROP TABLE IF EXISTS `issues_log`;
CREATE TABLE `issues_log` (
`issue_log_id` VARCHAR(64) NOT NULL,
`issue_id` VARCHAR(64) DEFAULT null,
`action_type` VARCHAR(64) DEFAULT null,
`action_value` VARCHAR(1024) DEFAULT null,
`action_comment` VARCHAR(3072) DEFAULT null,
`contour_image` VARCHAR(255) DEFAULT null,
`image1` VARCHAR(255) DEFAULT null,
`image2` VARCHAR(255) DEFAULT null,
`image3` VARCHAR(255) DEFAULT null,
`image4` VARCHAR(255) DEFAULT null,
`image5` VARCHAR(255) DEFAULT null,
`image6` VARCHAR(255) DEFAULT null,
`measurement_history_id` VARCHAR(64) DEFAULT null,
`created_by` VARCHAR(64) DEFAULT null,
`created_time` DATETIME DEFAULT null,
`updated_by` VARCHAR(64) DEFAULT null,
`updated_time` DATETIME DEFAULT null,
`is_deleted` INT DEFAULT 0,
`deleted_by` VARCHAR(64) DEFAULT null,
`deleted_time` DATETIME DEFAULT null,
PRIMARY KEY (`issue_log_id`)
);



DROP TABLE IF EXISTS `measurement`;
CREATE TABLE `measurement` (
`id` VARCHAR(64) NOT NULL,
`measurement_item_name` VARCHAR(255) DEFAULT null,
`min_value` INT DEFAULT null,
`max_value` INT DEFAULT null,
PRIMARY KEY (`id`)
);



DROP TABLE IF EXISTS `measurement_history`;
CREATE TABLE `measurement_history` (
`measurement_history_id` VARCHAR(64) NOT NULL,
`task_id` VARCHAR(64) NOT NULL,
