DROP TABLE IF EXISTS `task_group`;
CREATE TABLE `task_group` (
`task_group_id` VARCHAR(64) NOT NULL,
`task_group_desc` VARCHAR(1024) DEFAULT null,
`task_group` VARCHAR(64) DEFAULT null,
`project_id` VARCHAR(64) DEFAULT null,
`stage_id` VARCHAR(64) DEFAULT null,
`suite_count` INT DEFAULT null,
`room_count` INT DEFAULT null,
`task_type` VARCHAR(64) DEFAULT null,
`measurer` VARCHAR(64) DEFAULT null,
`project_workgroup_id` VARCHAR(64) DEFAULT null,
`company_measurement_rule_id` VARCHAR(64) DEFAULT null,
`created_by` VARCHAR(64) DEFAULT null,
`created_time` DATETIME DEFAULT null,
`updated_by` VARCHAR(64) DEFAULT null,
`updated_time` DATETIME DEFAULT null,
`is_deleted` INT DEFAULT 0,
`deleted_by` VARCHAR(64) DEFAULT null,
`deleted_time` DATETIME DEFAULT null,
PRIMARY KEY (`task_group_id`)
);



DROP TABLE IF EXISTS `tasks`;
CREATE TABLE `tasks` (
`task_id` VARCHAR(64) NOT NULL,
`task_group_id` VARCHAR(64) DEFAULT null,
`project_id` VARCHAR(64) NOT NULL,
`building_id` VARCHAR(64) NOT NULL,
`floor_id` VARCHAR(64) NOT NULL,
`suite_id` VARCHAR(64) NOT NULL,
`room_id` VARCHAR(64) NOT NULL,
`stage_id` VARCHAR(64) NOT NULL,
`task_state` VARCHAR(255) NOT NULL,
`task_type` VARCHAR(255) DEFAULT 'Measuring' COMMENT '任务类型',
`user_id` VARCHAR(64) NOT NULL,
`unit_id` VARCHAR(64) DEFAULT null,
`due_date` DATETIME DEFAULT null,
`last_scan_time` DATETIME DEFAULT null,
`project_workgroup_id` VARCHAR(64) DEFAULT null,
`company_measurement_rule_id` VARCHAR(64) DEFAULT null,
`is_combine_measurement` INT DEFAULT 0 COMMENT '0:非合并 1:合并',
`is_pass` INT DEFAULT 0,
`created_by` VARCHAR(64) NOT NULL,
`created_time` DATETIME DEFAULT null,
`is_deleted` INT DEFAULT 0,
`deleted_by` VARCHAR(64) DEFAULT null,
`deleted_time` DATETIME DEFAULT null,
PRIMARY KEY (`task_id`)
);



DROP TABLE IF EXISTS `temp1`;
CREATE TABLE `temp1` (
`history_id` INT NOT NULL,
`area` FLOAT DEFAULT null,
