DROP VIEW IF EXISTS `vw_op_roles`;
CREATE   VIEW `vw_op_roles` AS select `company`.`company_id` AS `op_role_id`,`company`.`company_name` AS `op_role_name`,'0' AS `op_role_type` from `company` union all select `project_units`.`unit_id` AS `op_role_id`,`project_units`.`unit_name` AS `op_role_name`,`project_units`.`unit_type` AS `op_role_type` from `project_units`;


DROP VIEW IF EXISTS `vw_stages`;
CREATE   VIEW `vw_stages` AS select `company_stage`.`company_id` AS `company_id`,`company_stage`.`stage_id` AS `stage_id`,`company_stage`.`stage_name` AS `stage_name` from `company_stage`;


DROP VIEW IF EXISTS `vw_users_and_staffs`;
CREATE   VIEW `vw_users_and_staffs` AS select `users`.`company_id` AS `company_id`,`users`.`user_id` AS `user_id`,`users`.`user_account` AS `user_account`,`users`.`user_name` AS `user_name`,`users`.`password` AS `password`,`users`.`salt` AS `salt`,`users`.`mobile_no` AS `mobile_no`,'' AS `id`,`users`.`user_state` AS `user_state`,'0' AS `user_mode`,`users`.`user_type` AS `user_type` from `users` where (`users`.`is_deleted` = 0) union select `staff`.`company_id` AS `company_id`,`staff`.`staff_id` AS `user_id`,ifnull(`staff`.`staff_account`,`staff`.`mobile_no`) AS `user_account`,`staff`.`staff_name` AS `user_name`,`staff`.`password` AS `password`,`staff`.`salt` AS `salt`,`staff`.`mobile_no` AS `mobile_no`,`staff`.`id` AS `id`,`staff`.`staff_state` AS `user_state`,'1' AS `user_mode`,'' AS `user_type` from `staff` where (`staff`.`is_deleted` = 0);


DROP VIEW IF EXISTS `vw_measurement_history_full`;
CREATE   VIEW `vw_measurement_history_full` AS select `a`.`measurement_history_id` AS `measurement_history_id`,`a`.`task_id` AS `task_id`,`t`.`task_state` AS `task_state`,`t`.`task_type` AS `task_type`,`t`.`created_time` AS `task_create_time`,`c`.`company_id` AS `company_id`,`c`.`company_name` AS `company_name`,`c`.`company_state` AS `company_state`,`c`.`license_start_date` AS `license_start_date`,`c`.`license_end_date` AS `license_end_date`,`a`.`project_id` AS `project_id`,`b`.`project_name` AS `project_name`,`b`.`address` AS `address`,`b`.`number_of_building` AS `number_of_building`,`b`.`project_leader` AS `project_leader`,`b`.`project_no` AS `project_no`,`b`.`project_state` AS `project_state`,`b`.`project_type` AS `project_type`,`b`.`project_unit` AS `project_unit`,`b`.`version` AS `project_version`,`m`.`project_name` AS `parent_project_name`,`b`.`supervisor` AS `supervisor`,`a`.`building_id` AS `building_id`,`d`.`building_no` AS `building_no`,`d`.`building_name` AS `building_name`,`d`.`number_of_floor` AS `number_of_floor`,`a`.`floor_id` AS `floor_id`,`e`.`floor_no` AS `floor_no`,`e`.`floor_name` AS `floor_name`,`a`.`suite_id` AS `suite_id`,`f`.`suite_no` AS `suite_no`,`f`.`suite_name` AS `suite_name`,`a`.`room_id` AS `room_id`,`g`.`room_no` AS `room_no`,`g`.`room_name` AS `room_name`,`g`.`room_template_id` AS `room_template_id`,`a`.`stage_id` AS `stage_id`,`s`.`stage_name` AS `stage_name`,`a`.`measurer` AS `measurer`,`h`.`user_name` AS `user_name`,`h`.`user_state` AS `user_state`,`h`.`user_type` AS `user_type`,`h`.`mobile_no` AS `mobile_no`,`a`.`measurement_time` AS `measurement_time`,`a`.`create_time` AS `create_time`,`q`.`model_access_code` AS `model_access_code`,`q`.`excel_access_code` AS `excel_access_code`,`y`.`suite_template_id` AS `suite_template_id`,`a`.`nuc_id` AS `nuc_id`,`a`.`nuc_version` AS `nuc_version`,`t`.`project_workgroup_id` AS `project_workgroup_id`,`a`.`anti_cheating_score` AS `anti_cheating_score`,`a`.`unit_id` AS `unit_id`,`a`.`history_type` AS `history_type`,`a`.`version` AS `history_version`,`a`.`draw_id` AS `draw_id`,`a`.`point_id` AS `point_id`,`p`.`section_name` AS `section_name`,`c`.`company_id` AS `op_role`,`r`.`unit_name` AS `unit_name` from (((((((((((((((`measurement_history` `a` join `projects` `b` on((`a`.`project_id` = `b`.`project_id`))) join `company` `c` on((`b`.`company_id` = `c`.`company_id`))) left join `tasks` `t` on((`a`.`task_id` = `t`.`task_id`))) left join `buildings` `d` on((`a`.`building_id` = `d`.`building_id`))) left join `floors` `e` on((`a`.`floor_id` = `e`.`floor_id`))) left join `suites` `f` on((`a`.`suite_id` = `f`.`suite_id`))) left join `rooms` `g` on((`a`.`room_id` = `g`.`room_id`))) left join `vw_users_and_staffs` `h` on((`a`.`measurer` = `h`.`user_id` ))) left join `vw_stages` `s` on(((`a`.`stage_id` = `s`.`stage_id`) and (`c`.`company_id` = `s`.`company_id`)))) left join `quick_links` `q` on((`a`.`measurement_history_id` = `q`.`history_id`))) left join `room_template` `y` on((`g`.`room_template_id` = `y`.`room_template_id`))) left join `projects` `m` on((`b`.`parent_project_id` = `m`.`project_id`))) left join `project_section_scope` `n` on(((`a`.`building_id` = `n`.`building_id`) and (`n`.`is_deleted` = 0)))) left join `project_sections` `p` on(((`n`.`section_id` = `p`.`section_id`) and (`p`.`is_deleted` = 0)))) left join `project_units` `r` on((`a`.`unit_id` = `r`.`unit_id`))) where (`a`.`is_deleted` = 0);


DROP VIEW IF EXISTS `vw_available_design_item`;
CREATE   VIEW `vw_available_design_item` AS select `company_context`.`company_id` AS `company_id`,`company_context`.`text` AS `design_item`,`company_context`.`value` AS `measurement_item_code` from `company_context` where (`company_context`.`category` = 'RoomStand');


DROP VIEW IF EXISTS `vw_available_measurement_items`;
CREATE   VIEW `vw_available_measurement_items` AS select `measurement_items`.`measurement_item_id` AS `measurement_item_id`,`measurement_items`.`measurement_item_code` AS `measurement_item_code`,`measurement_items`.`measurement_item_name` AS `measurement_item_name`,`measurement_items`.`measurement_item_desc` AS `measurement_item_desc`,`measurement_items`.`input_type` AS `input_type`,`measurement_items`.`value_type` AS `value_type`,`measurement_items`.`quality_algorithm` AS `quality_algorithm`,`measurement_items`.`state` AS `state`,`measurement_items`.`creator` AS `creator`,`measurement_items`.`create_time` AS `create_time`,`measurement_items`.`mapped_sdk_item_id` AS `mapped_sdk_item_id`,`measurement_items`.`unit` AS `unit` from `measurement_items` where (`measurement_items`.`state` = 1);


DROP VIEW IF EXISTS `vw_company_excel_templates`;
CREATE   VIEW `vw_company_excel_templates` AS select `a`.`comptpl_id` AS `comptpl_id`,`a`.`company_id` AS `company_id`,`a`.`template_id` AS `template_id`,`a`.`stage_id` AS `stage_id`,`a`.`scope` AS `scope`,`a`.`created_time` AS `created_time`,`b`.`template_name` AS `template_name`,`b`.`template_file_uri` AS `template_file_uri`,`b`.`template_state` AS `template_state`,`b`.`class_uri` AS `class_uri`,`b`.`category` AS `category` from (`company_excel_templates` `a` join `excel_templates` `b` on((`a`.`template_id` = `b`.`template_id`))) where ((`a`.`is_deleted` = 0) and (`b`.`is_deleted` = 0) and (`b`.`template_state` = 1));


DROP VIEW IF EXISTS `vw_company_measurement_items`;
CREATE   VIEW `vw_company_measurement_items` AS select `b`.`company_id` AS `company_id`,`a`.`measurement_item_id` AS `measurement_item_id`,`a`.`measurement_item_code` AS `measurement_item_code`,`a`.`measurement_item_name` AS `measurement_item_name`,`a`.`measurement_item_desc` AS `measurement_item_desc`,`a`.`input_type` AS `input_type`,`a`.`value_type` AS `value_type`,`a`.`quality_algorithm` AS `quality_algorithm`,`a`.`state` AS `state`,`a`.`creator` AS `created_by`,`a`.`create_time` AS `created_time`,`a`.`mapped_sdk_item_id` AS `mapped_sdk_item_id`,`a`.`unit` AS `unit`,`a`.`measurement_item_id` AS `platform_measurement_item_id`,'2.0' AS `version` from (`measurement_items` `a` join `company` `b`) where (1 = 1) union all select `t`.`company_id` AS `company_id`,`t`.`measurement_item_id` AS `measurement_item_id`,`p`.`measurement_item_code` AS `measurement_item_code`,`t`.`measurement_item_name` AS `measurement_item_name`,`t`.`measurement_item_desc` AS `measurement_item_desc`,`t`.`input_type` AS `input_type`,`t`.`value_type` AS `value_type`,`t`.`quality_algorithm` AS `quality_algorithm`,`t`.`state` AS `state`,`t`.`created_by` AS `created_by`,`t`.`created_time` AS `created_time`,`p`.`mapped_sdk_item_id` AS `mapped_sdk_item_id`,`t`.`unit` AS `unit`,`t`.`platform_measurement_item_id` AS `platform_measurement_item_id`,'3.0' AS `version` from (`company_measurement_items` `t` left join `measurement_items` `p` on((`t`.`platform_measurement_item_id` = `p`.`measurement_item_id`))) where (`t`.`is_deleted` = 0);


DROP VIEW IF EXISTS `vw_company_measurement_rules`;
CREATE   VIEW `vw_company_measurement_rules` AS select `a`.`template_id` AS `template_id`,`a`.`company_id` AS `company_id`,`b`.`company_name` AS `company_name`,`a`.`stage_id` AS `stage_id`,`c`.`stage_name` AS `stage_name`,`a`.`ref_template_id` AS `ref_template_id`,`d`.`user_name` AS `created_by`,`a`.`created_time` AS `created_time`,`a`.`measurement_rules_name` AS `measurement_rules_name`,`a`.`measurement_rules_desc` AS `measurement_rules_desc` from (((`company_measurement_rules` `a` join `company` `b` on((`a`.`company_id` = `b`.`company_id`))) join `company_stage` `c` on((`a`.`stage_id` = `c`.`stage_id`))) left join `users` `d` on((`a`.`created_by` = `d`.`user_id`))) where (`a`.`is_deleted` = 0);


